var tipuesearch = {"pages": [{'title': 'About', 'text': '\n Github 倉儲\xa0  https://github.com/s40523111/cp2019 \xa0\xa0 \n Youtube\xa0\xa0 https://www.youtube.com/playlist?list=PLuheK-guL65nFH1DVrtv9W7XTNXP6l_mQ \n', 'tags': '', 'url': 'About.html'}, {'title': '任務', 'text': '', 'tags': '', 'url': '任務.html'}, {'title': 'W2', 'text': '課程筆記 \n \n 隨身碟內資料 與 遠端倉儲 不一致 ， 可利用指令 git pull 合併兩者，再 add -> commit -> push 即可 \n Cmsimde 資料夾內如果沒東西的話 ， 可用指令 git submodule init -> git\xa0 submodule update \n 字幕影片轉換的指令\xa0\n ffmpeg -i 原影片名稱.mp4 -vf subtitles=字幕檔名稱.srt 轉出的影片名稱.mp4 \n \n LEO文章嵌入連結\xa0 <a href="網址">顯示的文字</a> \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': 'Dartpad引入Gist中的Dart程式 \n Dartpad 網址\xa0 https://dartpad.dartlang.org/?id=98715172dc3f22bf796622ff9aae07ff \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '在Cmsimde網頁中放入圖片\xa0 \n \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W6', 'text': 'for迴圈程式範例放入倉儲餅已embed-dartpad.html引用 \n 程式碼位於:\xa0 https://github.com/mdecourse/cp2019/tree/master/downloads/dart_ex/hello \n 原始碼: \n int i;\nint sum;\n \nmain(){\n  sum = 0;\n  for(i=1;i <= 10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n  print(\'sum = $sum\');\n} \n \n For loop 程式: \n \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'w8', 'text': '\n 1 . slug 每篇文章不能相同 \n 2 . Leo 節點操作指令\xa0 \n ctrl + i\xa0 \xa0新增 \n ctrl + u\xa0 \xa0往上 \n ctrl + d\xa0 \xa0往下 \n ctrl + l\xa0 \xa0 往左 \n ctrl + r\xa0 \xa0往右 \n 2. Leo 提交方式 \n local - blog -> goto script\xa0 近端提交 \n \n github - blog ->\xa0 goto script\xa0 遠端提交 \n \n \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w10', 'text': '開始進行分組週 \n 1.\xa0 建立小組倉儲以及網站 \n https://github.com/s40523111/cp2019bg5 \xa0 \xa0 \xa0BG10 Github \n \n https://s40523111.github.io/cp2019bg5/content/index.html \xa0 \xa0BG5 Cmsimde 網頁 \n \n 2.\xa0 使用SSH推送更新的資訊至倉儲 \n 3.\xa0 在小組Cmsimde網站中增加 溫度轉換的按鈕 以及 轉換之程式碼 \n \n', 'tags': '', 'url': 'w10.html'}, {'title': 'W11', 'text': '純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping    temperature \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '1. 新增 " 攝氏與華氏自動判別"\xa0 的按鈕 \n \n  取 Dart 程式的按鈕  \n 純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping    Temperature   CF_change \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n 2.\xa0 教學影片\xa0 \n \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'W13', 'text': '任務說明 :\xa0 沿用 W11 ~ W12 的方式，網頁中在Htmlt程式新增一個 Temp2 的按鈕，並且在近端新增 dart檔、yaml檔、html檔 和 style檔， 提交推送使網頁能成功顯示， 不管輸入的溫度是攝氏或者華氏，可以轉換成 攝氏或者華氏 ，所有動作完成之後，錄製影片說明操作步驟。 \n 小提醒 : 記得要確認好檔案所放的路徑位置，以及網頁程式碼有沒有打錯，如果網頁程式碼不確認哪裡有錯誤，個人建議刪掉重新打，增加印象。 \n \n  取 Dart 程式的按鈕  \n 純 Dart 程式 \n Temp1 \n Html 程式 \n Temp2    內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n \n 教學影片 \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '\n \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '任務一 :\xa0 建立亂數分組的 Html 按鈕 \n \n \n Html 程式 \n 亂數分組    內建放入的 Dart 原始碼  \n 放大   回復 \n \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16', 'text': 'Html 程式 \n USA    內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n 影片 \n', 'tags': '', 'url': 'W16.html'}]};